import color from "@material-ui/core/colors/lime";

export const styles = theme => ({
  "@global": {
    body: {
      margin: 0
    },
    "#__next": {
      // background: "yellow"
    }
  },
  root: {
    backgroundColor: "#2f3033"
  },
    container: {
      // background: "green",
      display: "flex",
      maxWidth: 1280,
      margin: "auto"
    },
    upperFooter: {
      borderBottom: `solid 1px #979797`,
      "& > $container": {
        height: 82,
        display: 'flex'
      }
    },
    beetwenFooter: {
      borderBottom: `solid 1px #979797`,
      "& > $container": {
        height: 218,
        display: "flex"
      }
    },
    lowerFooter: {
      borderBottom: `solid 1px #2f3033`,
      "& > $container": {
        height: 50,
        display: "flex"
        }
    },
    logo: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      fontSize: 18,
      fontWeight: 400,
      color: 'white'

    },
    categories: {
      backgroundColor: 'green',
      display: "flex",
      alignItems: "center",
      "& > div": {
        width: 200,
        height: 18,
        fontSize: 12,
        fontWeight: 400,
        flexDirection: 'column',
        paddingBottom: 100,
        color: 'white'
      },
    },
    inforBox: {
        display
    },
    emptySpacing: {
      flexGrow: 1
    }

});
